window.bookSummaryJSON = "<p><b>A massacre, a manuscript, and a demonic midnight bargain.</b></p> <p>Dustin Graves goes on a rare night out with the boys from the Boneyard, but things go horribly wrong. Over a hundred revelers drop dead at a pop diva’s concert, bleeding from their eyes and their ears. Miraculously, Dustin and his undead associates survive.</p> <p>But the troubles have just begun. Soon Dust is dealing with a bloodthirsty imp, a grizzled Scion, and a strange man covered in even stranger tattoos. Then Mammon, the demon prince of greed, comes knocking, eager to collect on Dustin’s end of the bargain….</p> <p>If you like snarky heroes, snappy dialogue, and a bit of grit and gore, you'll love the fourth book in Nazri Noor's series of urban fantasy novels. Explore the Darkling Mage universe and discover <i>Oblivion Heart</i> today.</p>"; 
